import React from 'react'
import TableData from './TableData'

function TableRow({ userContact }) {
    const userContactKeys = Object.keys(userContact)

    userContactKeys.map((userContactKey) => {
        console.log(userContact[userContactKey])
        if (userContactKey !== 'userId' && userContactKey !== 'contactId') {
            if (userContactKey === 'profile') {
                console.log(userContact[userContactKey])
                return (
                    <td>
                        <img
                            src={userContact[userContactKey]}
                            alt="user-profile"
                            className="profile-pic"
                        />
                    </td>
                )
            } else {
                return <td>{userContact[userContactKey]}</td>
            }
        }
    })

    return (
        <tr>
            hello
            {
                // return <TableData />
            }
        </tr>
    )
}
export default TableRow
